const Signage = () => {
  return (
    <section className="bg-gray-700 text-white py-20 px-6">
      <div className="text-center max-w-4xl mx-auto">
        <h2 className="text-4xl font-bold text-yellow-300 mb-6">Signage Solutions</h2>
        <p className="text-lg mb-4">
          We design bold, eye-catching signboards like:
        </p>
        <ul className="list-disc list-inside text-left text-lg space-y-2">
          <li>Paylon Sign Boards</li>
          <li>Edge Lip / Channel Letters</li>
          <li>Stainless Steel & Liquid Letters</li>
          <li>Neon Signage</li>
        </ul>
      </div>
    </section>
  );
};

export default Signage;
